devices:
 arch: [wormhole, wormhole_b0]

# device map
#     0   1   2   3   4   5   6   7
#    -------------------------------
# 0 |   |   |   |   |   |   |   |   |
#    -------------------------------
# 1 |   |   |   |   |   |   |   |   |
#    -------------------------------
# 2 |   |   |   |   | 2 | 1 | 4 | 7 |
#    -------------------------------
# 3 |   |   |   |   | 3 | 0*| 5 | 6 |
#    -------------------------------
# 4 |   |   |   |   |   |   |   |   |
#    -------------------------------


queues:
  q0        : {type: queue, input: HOST   , entries: 32, grid_size: [1, 1], t: 1, mblock: [4, 8], ublock: [2, 2], df: Float32, target_device: 0, loc: dram, dram: [[0, 0x10000000]]}
