  e2e_queue : {type: queue, input: matmul   , entries: 32, grid_size: [1, 1], t: 1, mblock: [4, 2], ublock: [2, 2], df: Float32, target_device: 3, loc: dram, dram: [[1, 0x10000000]]}

  output    : {type: queue, input: op3   , entries: 32, grid_size: [1, 1], t: 1, mblock: [4, 2], ublock: [2, 2], df: Float32, target_device: 0, loc: dram, dram: [[0, 0x20000000]]}


